import React from 'react';
import logo from './images/logos/logoips_poli.webp';
import './App.css';
import { Startbutton } from './components/Startbutton';

// Comentario corregido sobre la inclusión del archivo Startbutton
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Pagina para proyecto Frontend del Poli.
        </p>
        <Startbutton />
      </header>
      <TodoItem />
      <Noticias />
      <TodoItem />
      <TodoItem />
      <TodoItem />
      <TodoItem />
    </div>
  );
}

function Noticias() {
  return (
    <li>
      <p>Servicio X</p>
    </li>
  );
}

function TodoItem() {
  return (
    <li>
      <span>V</span>
      <p>Historia 1</p>
      <span>X</span>
    </li>
  );
}

export default App;
